content:
@BullTrade12 Du kan stänga omröstningen
Från SEB: 
Med anledning av det starka intresset kommer teckningsperioden för Storskogen Group AB (publ) ("Storskogen") att stänga kl 17.00 idag den 4 oktober, istället för den 5 oktober som tidigare kommunicerats.

@borskollen_news Storskogen ligger utanför min radar, men i sådana här lägen uttalar sig inte analytiker.

Deras arbetsgivare är involverade i transaktionen så de kommer troligen initiera med "Köp" 40 (?) dagar efter transaktionen stängts.

Däremot verkar journalister/tidningar vara skeptiska. 👍

@intentionell Många sa att EQT var skräp…
Titta vilket pe Stockvik handlas till…d enda vi vet är att om man vill vara säker på deg så kommer pepparkaksdegen snart till en butik nära dig 😇.
Äger Eqt och har tecknat några tusen Storskogen men d blir ju lottning. Ser dock att d har bra bolag…

@aktiealkoholist Och du då? 

Blir det Storskogen &amp; Spiltan? 

@aktiealkoholist

