content:
@A1pha_1 @LaBulll @stckpkr När Storskogen anlitar nio banker kommer de få nio analyser som pliktskyldigt initierar med "Köp".

Ur investerarnas synvinkel hade det varit "renare" om bolaget helt enkelt betalade för analys utan att den var kopplad till corporate finance.

Vi får se hur Storskogen gör. 😉

@CarinaS62 Född runt 90. Farsan lät mig ändå springa ut i storskogen utrustad med fickkniv när jag var 10 bast. Den var stor nog att jag hade kunnat gå vilse till ett annat landskap.

Han var lika frihetlig med att låta alla andra syskon utforska och skada sig.

👇
